import {useState} from 'react'


export default function ImputFiltrarProdutos() {

    const [visible, invisible] = useState()

    return (

        <div className="mr-3">
           <div className="">
            <svg class="h-8 w-8 text-sky-700"  width="24" height="24" viewBox="0 0 24 24" stroke-width="2" stroke="currentColor" fill="none" stroke-linecap="round" stroke-linejoin="round">  <path stroke="none" d="M0 0h24v24H0z"/>  <circle cx="10" cy="10" r="7" />  <line x1="21" y1="21" x2="15" y2="15" /></svg>
           </div>
           <form>
                <label>
                    <input className=" w-72 px-1 py-1 border-2 rounded-2xl text-current" type="text" placeholder="Type your wishes" name="name" />
                </label>
            </form>
        </div>
    )
}
